package imageslicer_test

import (
	"github.com/goferHiro/imageslicer"
	"image/color"
	"math/rand"
	"testing"
	"time"
)

func TestSlice(t *testing.T) {

	base64Image := ""

	base64Image = "data:image/jpeg;base64,"

	base64Image = "data:image/png;base64,"

	img, err := imageslicer.GetImageFromBase64(base64Image)
	if err != nil {
		t.Fatalf("%s unable to decode the img due to %v", t.Name(), err)
	}

	grids := [][2]uint{
		//{1, 0},
		{1, 1},
		{1, 2},
		{1, 10},
		//{2,0},
		{2, 1},
		{3, 1},
		{3, 2},
		{3, 3},
		{3, 6},
		{5, 6},
		{7, 20},
		{10, 10},
		{10, 20},
	}

	for _, grid := range grids {
		tiles := imageslicer.Slice(img, grid)

		expectedNoOfTiles := grid[0] * grid[1]

		if len(tiles) != int(expectedNoOfTiles) {
			t.Errorf("expected %d != %d", expectedNoOfTiles, len(tiles))
		} else {
			t.Logf("%v split passed", grid)
		}

		joinedImg, err := imageslicer.Join(tiles, grid)
		if err != nil {
			t.Errorf("joining failed due to %s", err)
		} else {
			shapeJ := joinedImg.Bounds()
			shapeI := img.Bounds()
			t.Logf("joinedImg %v %v", shapeJ, shapeI)

			if shapeI != shapeJ {
				t.Log("[JOIN] pixels lost while splitting")
			}
			rand.Seed(time.Now().UnixNano())

			testCoordinates := [][2]int{
				{shapeI.Min.X, shapeI.Min.Y},
			}
			maxY := shapeJ.Max.Y
			minY := shapeJ.Min.Y

			maxX := shapeJ.Max.X //ideally should be using origImg but that will fail for edge cases for certain imgs
			minX := shapeJ.Min.X

			for i := 0; i < (maxY + maxX); i++ { //TODO : should we test all coords
				randY := rand.Intn(maxY-minY+1) + minY
				randX := rand.Intn(maxX-minX+1) + minX

				testCoordinates = append(testCoordinates, [2]int{randX, randY})
			}

			for _, coord := range testCoordinates {
				x := coord[0]
				y := coord[1]

				colorI := img.At(x, y)
				colorJ := joinedImg.At(x, y)

				if compareColor(colorI, colorJ) {
					//t.Logf("coord %v", coord)
				} else {
					t.Errorf("failed coord %v", coord)
				}
			}

		}

	}

}

var compareColor = func(color1, color2 color.Color) (flag bool) {

	rC1, gC1, bC1, aC1 := color1.RGBA()

	rC2, gC2, bC2, aC2 := color1.RGBA()

	//flag = color1.RGBA() == color2.RGBA()

	flag = rC1 == rC2 && gC1 == gC2 && bC1 == bC2 && aC1 == aC2

	return
}
